import React from "react";
import "./ResultModal.css";

const ResultModal = (props) => {
  const endClick = () => {
    props.onClick();
  };

  return (
    <div>
      <div className="backdrop" />
      <div className="modal">
        <header className="header">
          <h2>hello</h2>
        </header>
        <div className="content">
          <div>Hello {props.name_of_user}</div>
          <div>
            <label>
              Thankyou For Your Response. Based on time spend hovering on every
              art sample, your current choice is {props.predictedValue}
            </label>
          </div>
          <div>
            <input type="text" />
          </div>
        </div>
        <footer className="actions">
          <button onClick={endClick} className="button_startmodal">
            Thankyou
          </button>
        </footer>
      </div>
    </div>
  );
};

export default ResultModal;
